// @ts-nocheck
declare namespace org {
    namespace bukkit {
        namespace loot {
            // @ts-ignore
            interface LootTable extends org.bukkit.Keyed {
                /**
                 * Returns a mutable list of loot generated by this LootTable.
                 */
                // @ts-ignore
                 populateLoot(random: java.util.Random, context: org.bukkit.loot.LootContext): java.util.Collection;
                /**
                 * Attempt to fill an inventory with this LootTable's loot.
                 */
                // @ts-ignore
                 fillInventory(inventory: org.bukkit.inventory.Inventory, random: java.util.Random, context: org.bukkit.loot.LootContext): void;
            }
        }
    }
}
